import Reac, { useState, useEffect } from 'react';
import Header from '../Header';
import Footer from '../Footer';
import axios from 'axios';
import './style.css';

export default function Files() {
    const [filesUploaded] = useState([]);

    useEffect(() => {
        axios.posts('http://localhost:5000/upload/')
            .then(res => {
                console.log("Je suis dans la route /files du front", res);
            })
            .catch(error => {
                console.log("J'affiche mon erreur", error)
            })
    })
        return(
            <div>
                <Header />
                <div className='hooks'>
                   <ul>
                      {filesUploaded.map(file => <li key={file.name}>{filesUploaded.nameVideo}</li>)} 
                    </ul>
                </div>
                
                <Footer />
            </div>
        )
}
